description:
La crise sanitaire et les conséquences économiques et sociales qui l’accompagnent ont remis en lumière la fragilité de nombreuses communes qui souffrent d’un déficit d’attractivité structurel. Afin de favoriser la création de nouvelles activités et d’emplois dans les territoires les plus vulnérables, des dispositifs fiscaux avantageux peuvent être mobilisés par les exécutifs locaux.
Les articles 110 et 111 de loi de finances pour 2020 ont ainsi instauré la possibilité pour les communes et les établissements publics de coopération intercommunale (EPCI) à fiscalité propre classés en zones de revitalisation des commerces en milieu rural (Zorcomir) et zones de revitalisation des centres-villes (ZRCV) de délibérer en faveur des commerces de proximité ou artisans des exonérations partielles ou totales de :
    taxe foncière sur les propriétés bâties (TFPB)   ;
    cotisation foncière des entreprises (CFE) ;
    cotisation sur la valeur ajoutée des entreprises (CVAE).
Ces deux dispositifs sont applicables jusqu’au 31 décembre 2023.
Sont classées en ZORCOMIR les communes qui, au 1er janvier 2020, satisfont aux trois conditions cumulatives suivantes :
    la population municipale est inférieure à 3 500 habitants;
    la commune n'appartient pas à une aire urbaine de plus de 10 000 emplois ;
    la commune comprend un nombre d'établissements exerçant une activité commerciale inférieur ou égal à dix.

Données sur la taxe d'aménagement par commune. Vous y trouverez :
- les liens pour télécharger (visualiser) par commune les délibérations pour l'application de la taxe d'aménagement sur leur territoire;
- les taux communaux applicables;
- en cas de sectorisation, l'indication si la commune comporte des secteurs et le taux de la taxe y à appliquer;
- les exonérations éventuellement votées pour les différents types (9 cas possibles) ainsi que leurs taux.
Référence réglementaire : Réforme de la fiscalité de l'aménagement adoptée dans le cadre de la loi 2010_1658 du 29/12/2010. L'article 28 créé un chapitre "Fiscalité d'aménagement (TA)", il est entré en vigueur le 1/03/2012

Une opération programmée d'amélioration de l'habitat a pour objectif de réhabiliter le patrimoine bâti et d'améliorer le confort des logements par le biais de subventions, ainsi que de requalifier dans son ensemble un quartier, une ville, ou un secteur rural. Elles tendent à améliorer l'offre de logements, en particulier locatif et ainsi à maintenir ou à développer les services de voisinage dans le respect du PLH. L’OPAH répond avant tout à un projet local, porté par la collectivité territoriale concernée, que l'État soutient au titre des enjeux de solidarité nationale et de lutte contre l’exclusion par le logement, dont il est porteur. Il existe principalement quatre types d’OPAH :  
\- L’OPAH de **droit commun** dont l’objet est de revaloriser des quartiers et leur habitat ;  
\- L’OPAH de **renouvellement urbain** qui a pour ambition de traiter les « zones urbaines et sociales les plus difficiles en créant des dispositifs faisant appel à des interventions foncières ou immobilières et à des outils coercitifs de droit public (traitement de l’insalubrité, démolitions…) ». Elle permet de coordonner différents outils (PRI, RHI, PSMV, ZPPAUP) ;  
\- L’OPAH de **revitalisation rurale** qui concerne les zones rurales en cours de «dévitalisation». Il s’agit des espaces ruraux qui se caractérisent par des déséquilibres démographiques, de revenus, et des conditions de vie difficiles.  
\- L’OPAH de **copropriété** qui offre un cadre de prévention et de traitement des copropriétés fragiles nécessitant l’appui de la puissance publique pour la réalisation des travaux indispensables à la conservation des bâtiments.  
Les OPAH sont conçues et mises en œuvre conjointement par l’État (le préfet de Région fixe les priorités et répartit les aides), l’ANAH et les collectivités qui signent une convention. Cette convention précise notamment les périmètres d’intervention : la collectivité concernée délimite ces périmètres et y fixe les objectifs, en concertation avec l’ANAH.

Ce jeu de données contient les périmètres de délimitation aux différents stades de l'élaboration du PPRN. Ces périmètres ont comme caractéristique d'être la conséquence d'un acte officiel et de produire leurs effets à compter d'une date définie. Il s'agit du :
- périmètre prescrit figurant dans l'arrêté de prescription d'un PPR (naturel ou technologique) ;
- périmètre d'exposition aux risques qui correspond au périmètre réglementé par le PPR approuvé. Ce périmètre approuvé vaut servitude d'utilité publique (PM1 pour les PPRN et PM3 pour les PPRT) ;
- périmètre d'étude qui correspond à l'enveloppe dans laquelle ont été étudiés les aléas.

