Il est applicable sur les communes de Brassac-les-Mines, Jumeaux, Auzat la Combelle, Beaulieu, Le Breuil sur Couze, Saint-Yvoine, Sauvagnat-Sainte-Marthe,Coudes et Yronde et Buron. Sur les autres communes initialement comprises dans le périmètre s'applique la révision du PPRi de 2016

