L’approbation par arrêté préfectoral du 4 novembre 2013 du PPRi du val d’Allier clermontois a rendu caducs le PER de Dallet pour le risque inondation. La partie PER mouvement de terrain gravitaire  (Mine des Roys de Dallet) restent opposables.

